const { jsPDF } = window.jspdf;

var fontInconsolataLGCNormal = '';
var fontInconsolataLGCBold = '';
var fontInconsolataLGCItalic = '';
var fontInconsolataLGCBoldItalic = '';

window.SaveSingleSongAsPDF = (filename, pdfJSON) => {
    var pdf = JSON.parse(pdfJSON);
    console.log(pdf);
    var doc;
    if (pdf.Pages.length > 0) {
        doc = new jsPDF({
            orientation: pdf.Pages[0].O,
            unit: 'mm',
            format: pdf.Pages[0].F,
            putOnlyUsedFonts: true,
            floatPrecision: 16 // or "smart", default is 16
        });
        doc.addFileToVFS('inconsolatalgcnormal-normal.ttf', fontInconsolataLGCNormal);
        doc.addFont('inconsolatalgcnormal-normal.ttf', 'Inconsolata-LGC', 'normal');

        doc.addFileToVFS('inconsolatalgcbold-bold.ttf', fontInconsolataLGCBold);
        doc.addFont('inconsolatalgcbold-bold.ttf', 'Inconsolata-LGC', 'bold');

        doc.addFileToVFS('inconsolatalgcbolditalic-bolditalic.ttf', fontInconsolataLGCBoldItalic);
        doc.addFont('inconsolatalgcbolditalic-bolditalic.ttf', 'Inconsolata-LGC', 'bolditalic');

        doc.addFileToVFS('inconsolatalgcitalic-italic.ttf', fontInconsolataLGCItalic);
        doc.addFont('inconsolatalgcitalic-italic.ttf', 'Inconsolata-LGC', 'italic');

        //console.log("Ready")
    }
    else {
        console.log("Invalid pdfJSON")
        return;
    }

    for (let pageIndex = 0; pageIndex < pdf.Pages.length; pageIndex++) {
        //for each page
        console.log("Page")
        if (pageIndex > 0) {
            //add new page
            console.log("Addpage")
            doc.addPage(pdf.Pages[pageIndex].F, pdf.Pages[pageIndex].O);
        }
        for (let commandIndex = 0; commandIndex < pdf.Pages[pageIndex].TC.length; commandIndex++) {
            //for each command
            //console.log("Command")
            doc.setFont("Inconsolata-LGC", pdf.Pages[pageIndex].TC[commandIndex].S);
            doc.setFontSize(pdf.Pages[pageIndex].TC[commandIndex].F);
            doc.text(pdf.Pages[pageIndex].TC[commandIndex].T, pdf.Pages[pageIndex].TC[commandIndex].X, pdf.Pages[pageIndex].TC[commandIndex].Y);
        }
    }
    //console.log("Done")

    doc.save(filename + ".pdf");
}